 import React from 'react';
import { Navbar, Nav, NavItem, Button } from 'react-bootstrap';
import logo from '../assets/msm_logo.png';
import $ from 'jquery';

export default props => {
    $('.canvas-toggle').hide();

    function sideNav() {
   
      if ($(window).width() <= 1133) {
   
        $('.sidebar').hide();
      } else {
   
        $('.sidebar').show();
      }
   
    }
   
    $('.canvas-toggle').click(function() {
      
    });
   
   
    $(window).resize(function() {
   
      sideNav();
   
    });
    return (
        <Nav>
        <aside class='sidebar'>
          <div class='main-nav'>
            <ul>
              <li class='logo'>
                <a>MSM</a>
                <i class="fa fa-leaf"></i>
              </li>
              <li class="side search">
                <a>
                  <input type="text" placeholder="" />
                </a>
                <i class="fa fa-search"></i>
              </li>
              <li>
                <a>Home</a>
                <i class='fa fa-home'></i>
              </li>
              <li>
                <a>Features</a>
                <i class='fa fa-cog'></i>
              </li>
              <li>
                <a>Analytics</a>
                <i class='fa fa-clipboard'></i>
              </li>
              <li>
                <a>Premium</a>
                <i class='fa fa-rocket'></i>
              </li>
              <li>
                <a>Account</a>
                <i class='fa fa-pencil'></i>
              </li>
              <li>
                <a>Settings</a>
                <i class='fa fa-cog'></i>
              </li>
            </ul>
          </div>
        </aside>
      </Nav>
    );
};
